// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./GigBlocksEnums.sol";

abstract contract GigBlocksUserManager is AccessControl, ReentrancyGuard {
    using GigBlocksEnums for GigBlocksEnums.JobCategory;

    struct UserProfile {
        string profileIPFS;
        uint8 flags;
        uint256 registrationDate;
        GigBlocksEnums.JobCategory[] preferences;
    }

    mapping(address => UserProfile) private users;
    address[] private userAddresses;

    event UserRegistered(
        address indexed user,
        uint256 registrationDate,
        bool isFreelancer,
        bool isClient
    );

    function register(
        string calldata _profileIPFS,
        GigBlocksEnums.JobCategory[] calldata _preferences,
        bool _isFreelancer,
        bool _isClient
    ) external nonReentrant {
        require(users[msg.sender].flags & 1 == 0, "User is already registered");
        require(
            _isFreelancer || _isClient,
            "User must be either freelancer or client or both"
        );

        UserProfile storage newUser = users[msg.sender];
        newUser.profileIPFS = _profileIPFS;
        newUser.preferences = _preferences;
        newUser.flags = 1 | (_isFreelancer ? 2 : 0) | (_isClient ? 4 : 0);
        newUser.registrationDate = uint256(block.timestamp);

        userAddresses.push(msg.sender);

        emit UserRegistered(
            msg.sender,
            uint256(block.timestamp),
            _isFreelancer,
            _isClient
        );
    }
}

